import React from 'react';
import { Button } from 'react-bootstrap';
import logo from '../logo.png';

const HeaderComponent = () => (
  <nav className="shadow-sm navbar navbar-expand-lg navbar-dark bg-dark bg-gradient">
    <div className="container-fluid p-0 d-flex">
      <img src={logo} width="200" alt="Войти" />
      <Button className="bg-secondary bg-gradient align-items-center">shipirdi</Button>
      <Button className="bg-dark bg-gradient align-items-center">shipirdi</Button>
      <Button className="bg-dark bg-gradient align-items-center">shipirdi</Button>
      <Button className="bg-dark bg-gradient align-items-center">shipirdi</Button>
      <div className="container-fluid p-2 d-flex align-items-end justify-content-end fw-weight-bolder">
        1PersonStudio
      </div>
    </div>
  </nav>
);

export default HeaderComponent;
